import React, { Component } from "react";
import NavBar from "./components/navbar";
import Gainers from "./components/gainers";
import Losers from "./components/losers";
import { BrowserRouter } from "react-router-dom";

class App extends Component {
  constructor() {
    super();
    this.state = {
      showComponent: false,
      api: "gainers"
    };
  }

  render() {
    return (
      <BrowserRouter>
        <React.Fragment>
          <NavBar />
          <button
            onClick={() =>
              this.setState({ api: "gainers", showComponent: true })
            }
          >
            Gainers
          </button>
          <button
            onClick={() =>
              this.setState({ api: "losers", showComponent: true })
            }
          >
            Losers
          </button>
          <button onClick={this.onButtonClick}>Button</button>
          <div>
            <Gainers {...this.state} />
          </div>
        </React.Fragment>
      </BrowserRouter>
    );
  }
}

export default App;
